import React, { useState } from "react";
import { Container, Button, Spinner, Alert } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";
import axios from "axios";

function App() {
  const [file, setFile] = useState(null);
  const [preview, setPreview] = useState("");
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");
  const [result, setResult] = useState(null);

  // API URL - change this to match your backend
  const API_URL = "http://localhost:5000";

  const handleFileChange = (e) => {
    if (e.target.files && e.target.files[0]) {
      const selectedFile = e.target.files[0];
      setFile(selectedFile);

      // Create preview
      const reader = new FileReader();
      reader.onload = (e) => setPreview(e.target.result);
      reader.readAsDataURL(selectedFile);
    }
  };

  const handleAnalyze = async () => {
    if (!file) {
      setError("Please select an image first");
      return;
    }

    setLoading(true);
    setError("");

    const formData = new FormData();
    formData.append("file", file);

    try {
      const response = await axios.post(`${API_URL}/detect-shape`, formData, {
        headers: {
          "Content-Type": "multipart/form-data",
        },
      });

      if (response.data.success) {
        setResult(response.data);
      } else {
        setError(response.data.message || "Shape detection failed");
      }
    } catch (err) {
      console.error("Error analyzing shape:", err);
      setError("Error connecting to the server. Please try again.");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="app">
      <header className="app-header">
        <h1>Shape Detector</h1>
        <p>Upload an image to detect shapes</p>
      </header>

      <main className="app-content">
        <Container className="py-4">
          <div className="text-center mb-4">
            <input
              type="file"
              accept="image/*"
              onChange={handleFileChange}
              className="form-control mb-3"
              id="fileInput"
            />

            {preview && (
              <div className="my-3">
                <img
                  src={preview}
                  alt="Preview"
                  className="img-thumbnail"
                  style={{ maxHeight: "300px" }}
                />
              </div>
            )}

            <Button
              variant="primary"
              onClick={handleAnalyze}
              disabled={loading || !file}
            >
              {loading ? (
                <>
                  <Spinner
                    as="span"
                    animation="border"
                    size="sm"
                    role="status"
                    aria-hidden="true"
                  />
                  <span className="ms-2">Processing...</span>
                </>
              ) : (
                "Analyze Image"
              )}
            </Button>
          </div>

          {error && (
            <Alert variant="danger" className="mt-3">
              {error}
            </Alert>
          )}

          {result && (
            <div className="mt-4 p-3 border rounded bg-light">
              <h3>Results:</h3>
              <p>
                <strong>Detected Shape:</strong> {result.shape}
              </p>
              {result.image_url && (
                <div className="mt-3">
                  <img
                    src={`${API_URL}/${result.image_url}`}
                    alt="Processed"
                    className="img-thumbnail"
                    style={{ maxHeight: "300px" }}
                  />
                </div>
              )}
            </div>
          )}
        </Container>
      </main>

      <footer className="app-footer">
        <p>&copy; {new Date().getFullYear()} Shape Detector App</p>
      </footer>
    </div>
  );
}

export default App;
